{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/markperchaluk/google-data-analytics-capstone-case-study-1?scriptVersionId=91494257\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"d780b960","metadata":{"papermill":{"duration":0.162434,"end_time":"2022-03-28T22:06:19.048205","exception":false,"start_time":"2022-03-28T22:06:18.885771","status":"completed"},"tags":[]},"source":["# Table of Contents\n","\n","[**Introduction**](#Introduction)\n","\n","[**Ask**](#Ask)\n","* Guiding Questions\n","* Key Tasks\n","* Deliverable\n","\n","[**Prepare**](#Prepare)\n","* Guiding Questions\n","* Key Tasks\n","* Deliverable\n","\n","[**Process**](#Process)\n","* Code\n","* Guiding Questions\n","* Key Tasks\n","* Deliverable\n","\n","[**Analyze**](#Analyze)\n","* Tableau Dashboard\n","* Guiding Questions\n","* Key Tasks\n","* Deliverable\n","\n","[**Share**](#Share)\n","* Guiding Questions\n","* Key Tasks\n","* Deliverable\n","\n","[**Act**](#Act)\n","* Guiding Questions\n","* Key Tasks\n","* Deliverable\n","\n","[**Conclusion**](#Conclusion)"]},{"cell_type":"markdown","id":"677624b0","metadata":{"papermill":{"duration":0.158382,"end_time":"2022-03-28T22:06:19.366235","exception":false,"start_time":"2022-03-28T22:06:19.207853","status":"completed"},"tags":[]},"source":["# **Introduction**\n","This is my project for the - Google Data Analytics Capstone - Case Study 1. The full documentation to the case study can be found in the [Google Data Analytics Capstone: Complete a Case Study](http://www.coursera.org/learn/google-data-analytics-capstone) course.\n","\n","For this project, these steps will be followed to ensure its completion:\n","\n","* Follow the steps of the data analysis process: Ask, prepare, process, analyze, share, and act.\n","    * Each step will follow its own roadmap with:\n","    * Code, if needed on the step.\n","    * Guiding questions, with answers.\n","    * Key tasks, as a checklist.\n","    * Deliverable, as a checklist."]},{"cell_type":"markdown","id":"c80c38a2","metadata":{"papermill":{"duration":0.163876,"end_time":"2022-03-28T22:06:19.690141","exception":false,"start_time":"2022-03-28T22:06:19.526265","status":"completed"},"tags":[]},"source":["# **Ask**  \n","Before this step, let's set the scenario from the cyclistic document:  \n","You are a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore,\n","your team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, your team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives\n","must approve your recommendations, so they must be backed up with compelling data insights and professional data visualizations.  \n","Characters and teams  \n","● Cyclistic: A bike-share program that features more than 5,800 bicycles and 600 docking stations. Cyclistic sets itself apart by also offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities and riders who can’t use a standard two-wheeled bike. The majority of riders opt for traditional bikes; about 8% of riders use the assistive options. Cyclistic users are more likely to ride for leisure, but about 30% use them to commute to work each day.    \n","● Lily Moreno: The director of marketing and your manager. Moreno is responsible for the development of campaigns and initiatives to promote the bike-share program. These may include email, social media, and other channels.  \n","● Cyclistic marketing analytics team: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy. You joined this team six months ago and have been busy learning about Cyclistic’s mission and business goals — as well as how you, as a junior data analyst, can help Cyclistic achieve them.  \n","● Cyclistic executive team: The notoriously detail-oriented executive team will decide whether to approve the recommended marketing program.  "]},{"cell_type":"markdown","id":"a0b49187","metadata":{"papermill":{"duration":0.15853,"end_time":"2022-03-28T22:06:20.00741","exception":false,"start_time":"2022-03-28T22:06:19.84888","status":"completed"},"tags":[]},"source":["#### **Guiding Questions**\n","\n","*What is the problem you are trying to solve?*  \n","The main objective is to figure out how annual members and casual riders use Cyclistic bikes differently.\n","\n","*How can your insights drive business decisions?*  \n","The insights will help the marketing team to increase annual members."]},{"cell_type":"markdown","id":"07f67070","metadata":{"papermill":{"duration":0.156984,"end_time":"2022-03-28T22:06:20.322783","exception":false,"start_time":"2022-03-28T22:06:20.165799","status":"completed"},"tags":[]},"source":["#### **Key tasks**\n","\n","*     [x] Identify the business task\n","*     [x] Consider key stakeholders"]},{"cell_type":"markdown","id":"10aca094","metadata":{"papermill":{"duration":0.156624,"end_time":"2022-03-28T22:06:20.635564","exception":false,"start_time":"2022-03-28T22:06:20.47894","status":"completed"},"tags":[]},"source":["#### **Deliverable**\n","\n","* [x] A clear statement of the business task  \n","\n","    Find out how annual members and casual riders use Cyclistic bikes differently."]},{"cell_type":"markdown","id":"58a1458d","metadata":{"papermill":{"duration":0.155966,"end_time":"2022-03-28T22:06:20.947691","exception":false,"start_time":"2022-03-28T22:06:20.791725","status":"completed"},"tags":[]},"source":["# **Prepare**  \n","The project will use the date provided by the Google case study [link](http://divvy-tripdata.s3.amazonaws.com/index.html)."]},{"cell_type":"markdown","id":"a3de146a","metadata":{"papermill":{"duration":0.157103,"end_time":"2022-03-28T22:06:21.264347","exception":false,"start_time":"2022-03-28T22:06:21.107244","status":"completed"},"tags":[]},"source":["#### **Guiding Questions**  \n","\n","*Where is your data located?*  \n","The data is located in the link provided by Google.\n","\n","*How is the data organized?*  \n","The data is separated by year and month, each on it's own zipped csv. The files consist of 13 columns containing information related to ride id, ridership type, ride time, start location and end location and geographic coordinates, etc.  \n","\n","*Are there issues with bias or credibility in this data? Does your data ROCCC?*  \n","Bias isn't a problem, the population of the dataset is it's own clients as bike riders and has full credibility for the same reason. And finally, it's ROCCC because it's reliable, original, comprehensive, current and cited.\n","\n","*How are you addressing licensing, privacy, security, and accessibility?*  \n","The company has their own [licence](http://ride.divvybikes.com/data-license-agreement) over the dataset and the dataset doesn't have any personal information about the riders.\n","\n","*How did you verify the data’s integrity?*  \n","All the files have consistent columns and each column has the correct type of data.\n","\n","*How does it help you answer your question?*  \n","It may have some key insights about the difference between members and casual riders.\n","\n","*Are there any problems with the data?*  \n","There are some problems with the data including: ducplicate records, and missing fields.\n","These can be resolved by data cleaning."]},{"cell_type":"markdown","id":"c90e6060","metadata":{"papermill":{"duration":0.158194,"end_time":"2022-03-28T22:06:21.580604","exception":false,"start_time":"2022-03-28T22:06:21.42241","status":"completed"},"tags":[]},"source":["#### **Key tasks**\n","* [x] Download data and store it appropriately.\n","* [x] Identify how it’s organized.\n","* [x] Sort and filter the data.\n","* [x] Determine the credibility of the data."]},{"cell_type":"markdown","id":"c21254f9","metadata":{"papermill":{"duration":0.157431,"end_time":"2022-03-28T22:06:21.894517","exception":false,"start_time":"2022-03-28T22:06:21.737086","status":"completed"},"tags":[]},"source":["#### **Deliverable**\n","* [x] A description of all data sources used\n","\n","The main data source is 12 months (Between December 2020 and November 2021) of riding data provided by the Cicylistic company."]},{"cell_type":"markdown","id":"e41a0b13","metadata":{"papermill":{"duration":0.156801,"end_time":"2022-03-28T22:06:22.208733","exception":false,"start_time":"2022-03-28T22:06:22.051932","status":"completed"},"tags":[]},"source":["# **Process**\n","### **Code**\n"]},{"cell_type":"markdown","id":"5d722203","metadata":{"papermill":{"duration":0.156234,"end_time":"2022-03-28T22:06:22.521644","exception":false,"start_time":"2022-03-28T22:06:22.36541","status":"completed"},"tags":[]},"source":["Install Packages."]},{"cell_type":"code","execution_count":1,"id":"107d4ef2","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","execution":{"iopub.execute_input":"2022-03-28T22:06:22.841176Z","iopub.status.busy":"2022-03-28T22:06:22.838979Z","iopub.status.idle":"2022-03-28T22:07:50.613965Z","shell.execute_reply":"2022-03-28T22:07:50.612554Z"},"papermill":{"duration":87.936065,"end_time":"2022-03-28T22:07:50.614233","exception":false,"start_time":"2022-03-28T22:06:22.678168","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","also installing the dependency ‘rlang’\n","\n","\n