t_time":"2022-03-28T22:11:41.570465","status":"completed"},"tags":[]},"outputs":[],"source":["all_trips_v5 <- mutate(all_trips_v5, ride_length_minutes = round(ride_length/60, digits = 0))"]},{"cell_type":"markdown","id":"ca465273","metadata":{"papermill":{"duration":0.227188,"end_time":"2022-03-28T22:11:42.349234","exception":false,"start_time":"2022-03-28T22:11:42.122046","status":"completed"},"tags":[]},"source":["Now to create a csv file to analyize the data in Tableau."]},{"cell_type":"code","execution_count":26,"id":"6fd0c750","metadata":{"execution":{"iopub.execute_input":"2022-03-28T22:11:42.810993Z","iopub.status.busy":"2022-03-28T22:11:42.809204Z","iopub.status.idle":"2022-03-28T22:13:25.274256Z","shell.execute_reply":"2022-03-28T22:13:25.272954Z"},"papermill":{"duration":102.697848,"end_time":"2022-03-28T22:13:25.274522","exception":false,"start_time":"2022-03-28T22:11:42.576674","status":"completed"},"tags":[]},"outputs":[],"source":["write.csv(all_trips_v5, \"all_trips_final.csv\", row.names = TRUE)"]},{"cell_type":"markdown","id":"4f68aa6b","metadata":{"papermill":{"duration":0.227045,"end_time":"2022-03-28T22:13:25.733742","exception":false,"start_time":"2022-03-28T22:13:25.506697","status":"completed"},"tags":[]},"source":["### **Guiding questions**\n","*What tools are you choosing and why?*  \n","I'm using R for this project, for two main reasons: Because of the large dataset and to gather experience with the language.\n","\n","*Have you ensured your data’s integrity?*  \n","Yes, the data is consistent throughout the columns.\n","\n","*What steps have you taken to ensure that your data is clean?*  \n","First the duplicated values where removed, then the columns where formatted to their correct format.\n","\n","*How can you verify that your data is clean and ready to analyze?*   \n","It can be verified by this notebook.\n","\n","*Have you documented your cleaning process so you can review and share those results?*   \n","Yes, it's all documented in the notebook"]},{"cell_type":"markdown","id":"1a214619","metadata":{"papermill":{"duration":0.231536,"end_time":"2022-03-28T22:13:26.192936","exception":false,"start_time":"2022-03-28T22:13:25.9614","status":"completed"},"tags":[]},"source":["### **Key tasks**\n","* [x] Check the data for errors.\n","* [x] Choose your tools.\n","* [x] Transform the data so you can work with it effectively\n","* [x] Document the cleaning process."]},{"cell_type":"markdown","id":"212721e6","metadata":{"papermill":{"duration":0.22527,"end_time":"2022-03-28T22:13:26.644345","exception":false,"start_time":"2022-03-28T22:13:26.419075","status":"completed"},"tags":[]},"source":["### **Deliverable**\n","* [x] Documentation of any cleaning or manipulation of data\n","\n"]},{"cell_type":"markdown","id":"9f91af93","metadata":{"papermill":{"duration":0.228212,"end_time":"2022-03-28T22:13:27.098443","exception":false,"start_time":"2022-03-28T22:13:26.870231","status":"completed"},"tags":[]},"source":["# **Analyze**\n","### **Tableau Dashboard**\n","[Dashboard](http://public.tableau.com/app/profile/mark.perchaluk/viz/GoogleDataAnalyticsKeystone/Dashboard1?publish=yes)"]},{"cell_type":"markdown","id":"fc12b780","metadata":{"papermill":{"duration":0.225763,"end_time":"2022-03-28T22:13:27.551484","exception":false,"start_time":"2022-03-28T22:13:27.325721","status":"completed"},"tags":[]},"source":["### **Guiding questions**\n","\n","*How should you organize your data to perform analysis on it?*  \n","The data has been organized into a single CSV concatenating all the files from the dataset.\n","\n","*Has your data been properly formatted?*  \n","Yes, all the columns have their correct data type.\n","\n","*What surprises did you discover in the data?*  \n","One of the main surprises is how members differ from casuals when analysed from weekdays. Also that members have less riding time than casual.\n","\n","*What trends or relationships did you find in the data?*  \n","There are more members than casuals in the dataset. \n","There are more of a difference between the flow of members/casual from midweek to weekends.  \n","Members use bikes on schedules that differs from casual.  \n","Members have less overall riding time.  \n","Members tend to prefer classic bikes, with hardly any docked bikes being used.  \n","\n","*How will these insights help answer your business questions?*  \n","This insights helps to build a profile for members.\n","\n","### **Key tasks**  \n","* [x] Aggregate your data so it’s useful and accessible.\n","* [x] Organize and format your data.\n","* [x] Perform calculations.\n","* [x] Identify trends and relationships.\n","\n","### **Deliverable**\n","* [x] A summary of your analysis"]},{"cell_type":"markdown","id":"2d900720","metadata":{"papermill":{"duration":0.23023,"end_time":"2022-03-28T22:13:28.010014","exception":false,"start_time":"2022-03-28T22:13:27.779784","status":"completed"},"tags":[]},"source":["# **Share**  \n","\n","Let's go through the main finds and try to arrive at a conclusion.  \n","\n","What we know about the dataset:  \n","\n","* Members have the biggest proportion of the dataset, ~11% bigger than casuals.   \n","* Members have 2 peaks of ride times 8AM and 5PM (We can assume this is going to and leaving work).  \n","* Casuals have rise in ride time till it peaks at 5PM.  \n","* In all months we have more member rides than casual rides.  \n","* The biggest volume of data is on the the weekend.  \n","* There's a bigger volume of bikers in the afternoon.  \n","\n","Besides that, we have more bike rides on the weekends. Maybe because on those days the bikes were utilized for more recreational ways. This even more plausible when knowing that There's a bigger volume of bikers in the afternoon.  \n","\n","Now for how members differs from casuals:  \n","\n","* Members may have the biggest volume of data.\n","* Weekends have the biggest volume of casuals, starting on friday, a ~20% increase.  \n","* We have more members during the morning, mainly between 5am and 11am. And more casuals between 11pm and 4am.  \n","* There's a big increase of data points in the midweek between 6am to 8am for members. Then it fell a bit. Another big increase is from 5pm to 6pm.  \n","* During the weekend we have a bigger flow of casuals between 11am to 6pm.  \n","* Members have a bigger preference for classic bikes, and do not ride the docked bikes much at all.   \n","* Casuals have more riding time than members.  \n","* Riding time for members keeps unchanged during the midweek, increasing during weekends.  \n","* Casuals follow a more curve distribution, peaking on sundays and valleying on wednesday/thursday.  \n","\n","What we can take from this information is that members have a more fixed use for bikes besides casuals. Their use is for more routine activities, like:  \n","\n","* Go to work.  \n","* Use it as an exercise.  \n","\n","This can be proven because we have more members in between 6am to 8am and at 5pm to 6pm. Also, members may have set routes when using the bikes, as proven by riding time for members keeps unchanged during the midweek, increasing during weekends. The bikes are also heavily used for recreation on the weekends, when riding time increases overall.    \n","\n","Concluding:  \n","\n","* Members use the bikes for fixed activities, one of those is going to work.  \n","* Bikes are used for recreation on the weekends.  \n","* Rides are influenced by temperature.  \n","\n","### **Guiding questions**  \n","*Were you able to answer the question of how annual members and casual riders use Cyclistic bikes differently?*\n","Yes. The data points to several differences between casuals and members.\n","\n","*What story does your data tell?*\n","The main story the data tells is that members have set schedules. Members use the bikes for routine activities, like going to work. Members also have less riding time, because they most likely have a set route to take.  \n","\n","*How do your findings relate to your original question?*\n","The findings build a profile for members, relating to \"Find the keys differences between casuals and annual riders.\"\n","    \n","*Who is your audience? What is the best way to communicate with them?*  \n","The main target audience is my cyclistic marketing analytics team and Lily Moreno. The best way to communicate is through a slide presentation of the findings or tableau dashboard.  \n","\n","*Can data visualization help you share your findings?*  \n","Yes, the main core of the finds is through data visualization.  \n","\n","*Is your presentation accessible to your audience?*  \n","Yes, the plots were made using vibrant colors, and corresponding labels.\n","\n","### **Key tasks**\n","* [x] Determine the best way to share your findings.\n","* [x] Create effective data visualizations.\n","* [x] Present your findings.\n","* [x] Ensure your work is accessible.\n","\n","### **Deliverable**\n","* [x] Supporting visualizations and key findings"]},{"cell_type":"markdown","id":"b72d4e42","metadata":{"papermill":{"duration":0.226097,"end_time":"2022-03-28T22:13:28.463373","exception":false,"start_time":"2022-03-28T22:13:28.237276","status":"completed"},"tags":[]},"source":["# **Act**  \n","\n","The act phase would be done by the marketing team of the company. The main takeaway will be the top three recommendations for the marketing.\n","\n","### **Guiding questions**\n","\n","*What is your final conclusion based on your analysis?*  \n","Members and casual have different habits when using the bikes. The conclusion is further stated on the share phase.  \n","\n","*How could your team and business apply your insights?*  \n","The insights could be implemented when preparing a marketing campaign for turning casuals into members.\n","\n","*What next steps would you or your stakeholders take based on your findings?*  \n","Further analysis could be done to improve the findings, besides that, the marketing team can take the main information to build a marketing campaign.\n","\n","*Is there additional data you could use to expand on your findings?*  \n","* Ages of riders.  \n","* Climate data.  \n","\n","### **Key tasks**  \n","* [x] Create your portfolio.\n","* [x] Add your case study.\n","* [x] Practice presenting your case study to a friend or family member.\n","\n","### **Deliverable**  \n","* [x] Your top three recommendations based on your analysis\n","1. Build a marketing campaign for casuals focusing on how becoming a member and taking a bike to work can be cheaper, healthier, and greener than takiing a vehicle.  \n","2. To reach the most riders, marketing should be targeted for the busiest casual rider days (Friday, Saturday and Sunday), and busiest hours (afternoon).\n","3. Since most casuals do their riding on the weekends, look into starting a weekend only membership."]},{"cell_type":"markdown","id":"7bd83b58","metadata":{"papermill":{"duration":0.225062,"end_time":"2022-03-28T22:13:28.91408","exception":false,"start_time":"2022-03-28T22:13:28.689018","status":"completed"},"tags":[]},"source":["# **Conclusion** \n","The Google Analytics Professional Certificate teached me a lot and the R language is really useful for analysing data. I prefer using Python/Jupytr Notebooks, but I do enjoy how R works, especially having all my data and visualizations in one graphical interface (RStudio).\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":433.922305,"end_time":"2022-03-28T22:13:29.557407","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-03-28T22:06:15.635102","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}